import React from "React";
import { BrowserRouter, Route, Routes } from "react-router";
import { Home } from "./Home";

const Test = () => <>test</>;

export const MyRouter = () => (
	<BrowserRouter>
		<Routes>
			<Route index element={<Home />} />
		</Routes>
	</BrowserRouter>
);
